import './Home.css';
import { BsCalendar, BsPerson, BsClock } from 'react-icons/bs';

const Home = () => {
  return (
    <>
      <section id='home' className='container home'>
          <div className='container blog-text'>
            <h1>5 top golang framework</h1>
            <span></span>
            <p>
              Framework adalah sebuah kerangka kerja yang digunakan
              untuk mengembangkan website. Framework ini diciptakan
              untuk membantu...
            </p>
          </div>
      </section>
    </>
  )
}

export default Home;
